import React from 'react';

// Example usage:
// <Frame10
//   imageSrc="/frame10.png"
//   altText="Frame 10"
//   links={[
//     { label: 'Home', url: '/' },
//     { label: 'About Us', url: '/about' },
//     // ...add more links here
//   ]}
// />

const Frame10 = ({
  imageSrc = '/frame10.png',
  altText = 'Frame 10',
  imageStyle = {},
  links = []
}) => {
  return (
    <div
      style={{
        width: '1440px',
        height: '338px',
        background: 'rgba(28,38,76,1)',
        padding: '40px 70px',
        display: 'flex',
        flexDirection: 'row',
        justifyContent: 'center',
        alignItems: 'center',
        boxSizing: 'border-box',
      }}
    >
      <div
        style={{
          display: 'flex',
          flexDirection: 'column',
          gap: '32px',
          width: '1301px',
          height: '204px',
          alignItems: 'center',
          background: 'rgba(28,38,76,1)',
        }}
      >
        <img
          src={imageSrc}
          alt={altText}
          style={{
            width: '1301px',
            height: '204px',
            objectFit: 'cover',
            background: 'rgba(28,38,76,1)',
            borderRadius: '0px',
            ...imageStyle
          }}
        />
        {/* Dynamic Links Row */}
        <div style={{ display: 'flex', gap: '32px', marginTop: '16px' }}>
          {links.map(link => (
            <a
              key={link.label}
              href={link.url}
              style={{ color: '#fff', textDecoration: 'none', fontFamily: 'Sora, sans-serif', fontWeight: 400, fontSize: '16px' }}
              target={link.url.startsWith('http') ? '_blank' : undefined}
              rel={link.url.startsWith('http') ? 'noopener noreferrer' : undefined}
            >
              {link.label}
            </a>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Frame10;
